    "This app brings a user interface to use the Nextcloud text processing feature.\n\nIt allows users to launch AI tasks, be notified when they finish and see the results.\nThe assistant also appears in others apps like Text to easily process parts of a document.\n\nMore details on the assistant OCS API and frontend integration possibilities in the\n[developer doc](https://github.com/nextcloud/assistant/raw/main/docs/developer)\n\n### How to use it\n\nA new right header menu entry appears. Once clicked, the assistant is displayed and you can select and task type and\nset the input you want to process.\n\nThe task might run immediately or be scheduled depending on the time estimation given by the AI provider.\nOnce a task is scheduled, it will run as a background job. When it is finished, you will receive a notification\nfrom which the results can be displayed.\n\nOther apps can integrate with the assistant. For example, Text will display an inline button besides every paragraph\nto directly select a task type to process this paragraph. Selecting a task this way will open the assistant with the task\nbeing pre-selected and the input text set.\n\nMore details and screenshots in the [user doc](https://github.com/nextcloud/assistant/raw/main/docs/user).\n\n## Features\n\nIn the assistant, the list of available tasks depends on the available providers installed via other apps.\nThis means you have complete freedom over which service/software will actually run your AI tasks.\n\n### Text processing providers\n\nSo far, the [Local Large language model](https://github.com/nextcloud/llm2#readme)\nand the [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai) apps\ninclude text processing providers to:\n* Summarize\n* Extract topics\n* Generate a headline\n* Get an answer from a free prompt\n* Reformulate (OpenAi/LocalAi only)\n* Context writer: Generate text with a specified style. The style can be described or provided via an example text.\n\n### Text to image (Image generation)\n\nKnown providers:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Text2Image Stable Diffusion](https://apps.nextcloud.com/apps/text2image_stablediffusion)\n\n### Speech to text (Audio transcription)\n\nKnown providers:\n* [OpenAi/LocalAI integration](https://apps.nextcloud.com/apps/integration_openai)\n* [Local Whisper Speech-To-Text](https://apps.nextcloud.com/apps/stt_whisper)\n\nMore details on how to set this up in the [admin docs](https://docs.nextcloud.com/server/latest/admin_manual/ai/index.html)" : "Programu hii huleta kiolesura cha mtumiaji kutumia kipengele cha uchakataji maandishi cha Nextcloud.\n\nHuruhusu watumiaji kuzindua kazi za AI, wajulishwe wanapomaliza na kuona matokeo.\nMratibu pia huonekana katika programu zingine kama Maandishi ili kuchakata sehemu za hati kwa urahisi.\n### Jinsi ya kuitumia\n\nIngizo jipya la menyu ya kichwa cha kulia linaonekana. Mara baada ya kubofya, msaidizi huonyeshwa na unaweza kuchagua na aina ya kazi na\nweka pembejeo unayotaka kuchakata.\n\nJukumu linaweza kutekelezwa mara moja au kuratibiwa kulingana na makadirio ya muda yaliyotolewa na mtoa huduma wa AI.\nMara tu kazi itakaporatibiwa, itaendeshwa kama kazi ya usuli. Ikikamilika, utapokea arifa\nambayo matokeo yanaweza kuonyeshwa.\n\nProgramu zingine zinaweza kuunganishwa na msaidizi. Kwa mfano, Maandishi yataonyesha kitufe cha ndani kando ya kila aya\nkuchagua moja kwa moja aina ya kazi ya kuchakata aya hii. Kuchagua kazi kwa njia hii itafungua msaidizi na kazi\nkuchaguliwa mapema na kuweka maandishi ya ingizo\n\nMaelezo zaidi na picha za skrini katika [hati ya mtumiaji](https://github.com/nextcloud/assistant/raw/main/docs/user).\n\n## Vipengele\n\nKatika msaidizi, orodha ya kazi zinazopatikana inategemea watoa huduma waliowekwa kupitia programu nyingine.\nHii inamaanisha kuwa una uhuru kamili juu ya huduma/programu gani itaendesha kazi zako za AI.\n\n### Watoa huduma za kuchakata maandishi\n\nKufikia sasa, [Muundo wa Lugha Kubwa ya Ndani](https://github.com/nextcloud/llm2#readme)\nna programu za [OpenAi/LocalAI](https://apps.nextcloud.com/apps/integration_openai)\nni pamoja na watoa huduma za usindikaji wa maandishi kwa:\n* Fanya muhtasari\n* Dondoo mada\n* Tengeneza kichwa cha habari\n* Pata jibu kutoka kwa kidokezo cha bure\n* Rekebisha (OpenAi/LocalAi pekee)\n* Mwandishi wa muktadha: Tengeneza maandishi kwa mtindo maalum. Mtindo unaweza kuelezewa au kutolewa kupitia maandishi ya mfano.\n\n### Maandishi kwa picha (Uzalishaji wa picha)\n\nWatoa huduma wanaojulikana:\n* [Muunganisho wa OpenAi/LocalAI](https://apps.nextcloud.com/apps/integration_openai)\n* [Text2Image Usambazaji Imara](https://apps.nextcloud.com/apps/text2image_stablediffusion)\n\n### Hotuba kwa maandishi (Unukuzi wa sauti)\n\nWatoa huduma wanaojulikana:\n* [Muunganisho wa OpenAi/LocalAI](https://apps.nextcloud.com/apps/integration_openai)\n* [Hotuba ya kunong'ona-Kwa-Maandishi ya Ndani](https://apps.nextcloud.com/apps/stt_whisper)\n\nMaelezo zaidi kuhusu jinsi ya kusanidi hii katika [hati za msimamizi](https://docs.nextcloud.com/server/latest/admin_manual/ai/index.html)",
